import React from "react";
import "./App.css";
import Main from "./layout/Main";
import logo from "./Assets/logo copy.svg";
import { BrowserRouter, Link } from "react-router-dom";
const App = () => {
  return (
    <>
      <BrowserRouter>
        <Link to="/">
          <img className="logoHeader" src={logo}></img>
        </Link>
        <Main />
      </BrowserRouter>
    </>
  );
};
export default App;
